import { useSelector, useDispatch} from 'react-redux';
import {
    selectCount,
    selectText
} from '../Counter/counterSlice';

import {
    increment,
    selectMytext
} from './mytextSlice';

export default function DataDesk(){
    const count = useSelector(selectCount);
    const text = useSelector(selectText);
    const t = useSelector(selectText);
    const dispatch = useDispatch();

    const changeText = () =>{
        console.log('work');
        dispatch(increment());
    }

    return(
        <div>
            <hr />
            <h1>Data Desk</h1>
            <h2>{count}</h2>
            <h2>{text}</h2>
            <h2 onClick={changeText}>0{t}0</h2>
        </div>
    )
}
